CREATE DATABASE IF NOT EXISTS luis_simoes;
USE luis_simoes;

CREATE TABLE IF NOT EXISTS tbl_00(
   PLATAFORMA   VARCHAR(2) NOT NULL
  ,CLIENTE      INTEGER  NOT NULL
  ,ARTICULO     INTEGER  NOT NULL
  ,TOT_STOCK    INTEGER  NOT NULL
  ,TOTAL_LINEAS INTEGER  NOT NULL
);


CREATE TABLE IF NOT EXISTS tbl_01(
   PLATAFORMA VARCHAR(2) NOT NULL
  ,CLIENTE    INTEGER  NOT NULL
  ,ARTICULO   INTEGER  NOT NULL
  ,ALMACEN    VARCHAR(3) NOT NULL
  ,UBICACION  VARCHAR(7) NOT NULL
  ,ID         INTEGER  NOT NULL
  ,LOTE       VARCHAR(10) NOT NULL
  ,UNIDADES   INTEGER  NOT NULL
);

CREATE TABLE IF NOT EXISTS tbl_02(
   PLATAFORMA VARCHAR(2) NOT NULL
  ,CLIENTE    VARCHAR(5) NOT NULL
  ,ID         INTEGER  NOT NULL
  ,SSCC       TEXT NOT NULL
);
